&amp;Ucirc;    artists, along with such luminaries as Jane Fonda, Michael Douglas       &amp;Ucirc;
&amp;Ucirc;    and Sidney Poitier. But the true &quot;star&quot; of TELL THEM WHO YOU ARE is      &amp;Ucirc;
&amp;Ucirc;    Haskell himself, a controversial, larger-than-life character who         &amp;Ucirc;
&amp;Ucirc;    challenges his son's filmmaking skills while announcing with complete    &amp;Ucirc;
&amp;Ucirc;    conviction that he could have done a better job directing most of the    &amp;Ucirc;
&amp;Ucirc;    movies he's shot. As these two men swap positions on camera and          &amp;Ucirc;
&amp;Ucirc;    behind it - sometimes shooting one another simultaneously - the film     &amp;Ucirc;
